const SidebarItem = ({ item }) => {
  return (
    <a className='sidebar-item' href='/' style={{ backgroundColor: 'gray' }}>
      <span>{item.display}</span>
      <img src={item.image} alt='' />
    </a>
  );
};

export default SidebarItem;
